const ProductCard = (props) => {
    const productCardClicked = () => {
      props.onCardClicked(props.id);
    };

    return (
      <li onClick={productCardClicked} className="productsListitem ">
        <img className="productsListimg" src={props.productImg} alt={props.name} />
        <div className="productsListfade">
          <p className="productsListimageText">{props.name}</p>
        </div>
      </li>
    );
  };
